import * as React from 'react';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import Container from '@material-ui/core/Container';
import { BrowserRouter as Router, Route, Link as ReactRouterLink } from 'react-router-dom';

class Portfolio extends React.Component{
    render() {
    return (
        <div className="Portfolio">
            <header className="Portfolio-header">
                <Container>
                    <Typography style={
                    {
                        textAlign: "center", 
                        fontFamily: "monospace",
                        fontSize: 60,
                    }}
                    >
                     Portfolio
                    </Typography>
                </Container>    
            </header>
            <Router>
                <div>
                    <List style={{margin: '12px', display: 'flex', textAlign: 'center'}}>
                        <ListItem style={{fontSize: '1.6rem', textDecoration: 'none'}}
                            button
                            className="appbutton"
                        >
                        <Button component={ReactRouterLink} to="/app1">App1</Button>
                        </ListItem>
                    </List>
                </div>
            </Router>
        </div>
    );
                }
}
export default Portfolio
